import React from 'react';
import {
    Image,
    StyleSheet,
    View,
    ScrollView,
    SafeAreaView,
    Text,
    TouchableOpacity,
  } from "react-native";

function MainScreen(props) {
    return (
        <SafeAreaView>
            <View style={styles.background1}></View>
            
            <Image source={require("../assets/beach1.jpg")}
            
            />
            
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    background1:{
        flex: 1,
        backgroundColor:'#569bdc',
    },

    imageContain: {
        
        height: 250,
        width: 250,
        
      },

    

})

export default MainScreen;
